  [],\n\t\"revision_timestamp\": \"2015-09-26T23:13:36.334554\",\n\t\"name\": \"oceanographic-profile-data-collected-from-ctd-casts-aboard-bay-hydro-ii-as-part-of-project-opr-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130297 includes physical
  and profile data collected aboard the Bay Hydro II during project OPR-E349-BH2-2014
  in the North Atlantic Ocean from 2014-05-19 to 2014-12-17. These data include CONDUCTIVITY,
  HYDROSTATIC PRESSURE, SALINITY, SOUND VELOCITY, WATER DENSITY and WATER TEMPERATURE.
  The instruments used to collect these data include CTD. These data were collected
  and submitted by the NOAA Office of Coast Survey in support of hydrographic multibeam
  surveys to meet NOAA charting requirements.\",\n\t\"license_title\": null,\n\t\"extras\":
